import React from "react";
import { Link } from "react-router-dom";
import icon from '../../Assets/favicon.png'

const NavBar = () => {
  return (
    <div>
      <Link to={"/"}>
        <img src={icon} alt="" />
      </Link>
      <Link to={"/activities"}>
        <button>To Activities</button>
      </Link>
      <Link to={"/activity"}>
        <button>Create Activities</button>
      </Link>
    </div>
  );
};

export default NavBar;
